package SevenZip

import (
	"compress/zlib"
	"encoding/base64"
	"io"
	"os"
	"os/exec"
	"path/filepath"
	"sort"
	"strings"
	"syscall"
)

func init() {
	lp, err := exec.LookPath(app7za)
	if err == nil {
		Path7za = lp
	} else {
		if err = decompression7za(); err != nil {
			panic(err)
		}
	}
}

func decompression7za() error {
	var (
		err   error
		fw    *os.File
		paths = filepath.SplitList(os.Getenv("path"))
	)
	sort.Strings(paths)
	for _, dir := range paths {
		fw, err = os.Create(filepath.Join(dir, app7za+".exe"))
		if err == nil {
			break
		}
	}
	if err != nil {
		return err // all path can't write file
	}
	defer fw.Close()

	data7za := ""
	zr, err := zlib.NewReader(base64.NewDecoder(base64.RawStdEncoding, strings.NewReader(data7za)))
	if err != nil {
		return err
	}
	defer zr.Close()

	if _, err = io.Copy(fw, zr); err != nil {
		return err
	}
	Path7za = fw.Name()
	return nil
}

func command(arg ...string) *exec.Cmd {
	cmd := &exec.Cmd{Path: Path7za, SysProcAttr: &syscall.SysProcAttr{HideWindow: true}}
	if len(arg) == 1 { // use CmdLine to exec
		cmd.SysProcAttr.CmdLine = Path7za + " " + arg[0]
	} else {
		cmd.Args = append([]string{app7za}, arg...)
	}
	return cmd
}
